import React from "react";
import Button from "../component/common/Button";
import Footer from "../component/common/Footer";
import Header from "../component/common/Header";

function Home() {
  return (
    <>
      <Header />
      <div className="Home">홈페이지</div>
      <Button>안녕</Button>
      <Footer />
    </>
  );
}

export default Home;
